import React from 'react';
import './app.css'
import Navbar from "./navbar/Navbar";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
    return (
        <div className="app">
            <Navbar/>
            <Router>
                <Navbar />
                <Routes>
                    <Route path="/" element={<App />} />
                </Routes>
            </Router>
        </div>
    );
}

export default App;
